        public class AnimationConfigItem
        {
            public int id { get; set; }
            public string title { get; set; }
            public string[] animData { get; set; }
            public int flag { get; set; }
            public bool looped { get; set; }
            public string music { get; set; }
            public string type { get; set; }
            public int rarity { get; set; }
            //public List<AnimationPropsData> propData { get; set; }

            public AnimationConfigItem(int Id, string Title, string[] AnimData, int Flag, bool Looped, string Music, string Type, int Rarity)
            {
                id = Id;
                title = Title;
                animData = AnimData;
                flag = Flag;
                looped = Looped;
                music = Music;
                type = Type;
                rarity = Rarity;
           }
        }
